css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.appbank.net") {

/* Non-display part */
ins,
iframe,
#menu,
.banner_980x120,
.banner_468xx60,
#cse-search-box,
#information,
#footer,
.right,
.another,
#outbrain_widget_0
{ display: none !important; }

/* Display part */
body,
#wrapper,
#header,
#content,
.left,
.column
{
    width: auto !important;
    background: #ffffff !important;
    border: none !important;
    overflow: visible !important;
    float: none !important;
}

}
